import styled from "styled-components";

export const TutorsList = styled.div`
  height: 30%;
  width: 100%;
  overflow-y: scroll;
`

export const TutorInfo = styled.div`
  height: 45%;
  width: 100%;
  border-width: 1px;
  border-style: solid;
  border-color: #5CDB95;
  text-transform: uppercase;
  color: #5CDB95;
  font-size: .76em;
  box-sizing: border-box;
  padding: .5rem;
`
